function HeaderApp() {
  return (
    <header className="headerApp">
      <img src="logo.jpeg" alt="Los Angeles" className="d-block" style={{width:"100%",height:"100%"}} />
      <a href="http://localhost:3000" className="headerLink">
        {/* <img  src="logo.jpeg" alt="logo" className="headerimg" /> */}
        <img  src="logo.jpeg" alt="logo" className="headerimg" />
        <img  src="logo2.jpeg" alt="logo2" className="headerimg" />
      </a>
      <a href="http://localhost:3000" className="headerLink">
        <h1 className="headerH1">樂享大師國際音樂營</h1>
      </a>

    </header>
  );
};

export default HeaderApp;
